import Head from 'next/head';
import Navegacion from './Navegacion';

const MasterPage = (props) =>{
    return(
        <div>
            <Head>
                <title>Terabit</title>
                <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no" />
            </Head>

            <Navegacion />

        {props.children}
    </div>
    )
};

export default MasterPage;
